`,paraId:10,tocIndex:5},{value:"\u6211\u4EEC\u5728 router/\u6587\u4EF6\u5939\u4E0B\u65B0\u5EFA\u4E00\u4E2A routerFactory.js \u6587\u4EF6\uFF0C\u5BFC\u51FA routerFactory \u7B80\u5355\u5DE5\u5382\u51FD\u6570\uFF0C\u7528\u4E8E\u6839\u636E\u7528\u6237\u6743\u9650\u63D0\u4F9B\u8DEF\u7531\u6743\u9650\uFF0C\u4EE3\u7801\u5982\u4E0B",paraId:11,tocIndex:5},{value:`//routerFactory.js

import SuperAdmin from '../components/SuperAdmin.vue';
import NormalAdmin from '../components/Admin.vue';
import User from '../components/User.vue';
import NotFound404 from '../components/404.vue';

let AllRoute = [
  //\u8D85\u7EA7\u7BA1\u7406\u5458\u9875\u9762
  {
    path: '/super-admin',
    name: 'SuperAdmin',
    component: SuperAdmin,
  },
  //\u666E\u901A\u7BA1\u7406\u5458\u9875\u9762
  {
    path: '/normal-admin',
    name: 'NormalAdmin',
    component: NormalAdmin,
  },
  //\u666E\u901A\u7528\u6237\u9875\u9762
  {
    path: '/user',
    name: 'User',
    component: User,
  },
  //404\u9875\u9762
  {
    path: '*',
    name: 'NotFound404',
    component: NotFound404,
  },
];

let routerFactory = (role) => {
  switch (role) {
    case 'superAdmin':
      return {
        name: 'SuperAdmin',
        route: AllRoute,
      };
      break;
    case 'normalAdmin':
      return {
        name: 'NormalAdmin',
        route: AllRoute.splice(1),
      };
      break;
    case 'user':
      return {
        name: 'User',
        route: AllRoute.splice(2),
      };
      break;
    default:
      throw new Error('\u53C2\u6570\u9519\u8BEF! \u53EF\u9009\u53C2\u6570: superAdmin, normalAdmin, user');
  }
};

export { routerFactory };
`,paraId:12,tocIndex:5},{value:"\u5728\u767B\u9646\u9875\u5BFC\u5165\u8BE5\u65B9\u6CD5\uFF0C\u8BF7\u6C42\u767B\u9646\u63A5\u53E3\u540E\u6839\u636E\u6743\u9650\u6DFB\u52A0\u8DEF\u7531:",paraId:13,tocIndex:5},{value:`//Login.vue

import { routerFactory } from '../router/routerFactory.js';
export default {
  //...
  methods: {
    userLogin() {
      //\u8BF7\u6C42\u767B\u9646\u63A5\u53E3, \u83B7\u53D6\u7528\u6237\u6743\u9650, \u6839\u636E\u6743\u9650\u8C03\u7528this.getRoute\u65B9\u6CD5
      //..
    },

    getRoute(role) {
      //\u6839\u636E\u6743\u9650\u8C03\u7528routerFactory\u65B9\u6CD5
      let routerObj = routerFactory(role);

      //\u7ED9vue-router\u6DFB\u52A0\u8BE5\u6743\u9650\u6240\u62E5\u6709\u7684\u8DEF\u7531\u9875\u9762
      this.$router.addRoutes(routerObj.route);

      //\u8DF3\u8F6C\u5230\u76F8\u5E94\u9875\u9762
      this.$router.push({ name: routerObj.name });
    },
  },
};
