function sum(a, b) {
  console.log(a + b);
}

sum(1, 2); //\u8F93\u51FA3
sum(1, 3); //\u8F93\u51FA4

//\u67EF\u91CC\u5316\u51FD\u6570
function curry(a) {
  return (b) => {
    console.log(a + b);
  };
}

const sum = curry(1);

sum(2); //\u8F93\u51FA3
sum(3); //\u8F93\u51FA4
